import {NgModule} from '@angular/core';

import {SharedModule} from 'app/shared/shared.module';

import {EmployerProfileRoutingModule} from './route/employer-profile-routing.module';
import {EmployerProfileComponent} from './employer-profile.component';
import {SearchEmployerProfileComponent} from './search/search-employer.component';
import {EPCreateComponent} from './create/ep-create.component';
import {EPAmendmentHistoryComponent} from './amendment-history/amendment-history.component';

import {FormsModule, ReactiveFormsModule} from '@angular/forms';
import {TableModule} from 'primeng/table';
import {ConfirmationService, MessageService} from 'primeng/api';
import {ConfirmPopupModule} from 'primeng/confirmpopup';
import {CalendarModule} from 'primeng/calendar';

import {TabViewModule} from 'primeng/tabview';
import {PanelModule} from 'primeng/panel';
import {CardModule} from 'primeng/card';
import {InputTextModule} from 'primeng/inputtext';
import {ButtonModule} from 'primeng/button';
import {DropdownModule} from 'primeng/dropdown';
import {InputNumberModule} from 'primeng/inputnumber';
import {KeyFilterModule} from 'primeng/keyfilter';
import {AdmendmentSnapshotComponent} from './admendment-snapshot/admendment-snapshot.component';
import {AmendmentTypePipe} from './amendment-history/amendment-history.pipe';
import {UserService} from 'app/admin/access-control';
import { NspConfirmationService } from 'app/shared/confirm/nsp-confirm.service';
import { DialogService } from 'primeng/dynamicdialog';
import { IcCodeService } from 'app/ng-connect';
import { MultiSelectModule } from 'primeng/multiselect';
import {ConfirmDialogModule} from 'primeng/confirmdialog';
@NgModule({
  imports: [SharedModule,
    EmployerProfileRoutingModule,
    TabViewModule,
    PanelModule,
    ButtonModule,
    InputTextModule,
    InputNumberModule,
    CardModule,
    TableModule,
    DropdownModule,
    ConfirmPopupModule,
    KeyFilterModule,
    CalendarModule,
    FormsModule,
    ReactiveFormsModule,
    MultiSelectModule,
    ConfirmDialogModule
  ],
  declarations: [
    EmployerProfileComponent,
    SearchEmployerProfileComponent,
    EPAmendmentHistoryComponent,
    EPCreateComponent,
    AdmendmentSnapshotComponent,
    AmendmentTypePipe
  ],
  providers: [
    ConfirmationService,
    MessageService,
    UserService,
    NspConfirmationService,
    DialogService,
    IcCodeService
  ],
  exports: [
   AmendmentTypePipe
  ],
})
export class EmployerProfileModule {
}
